import { useState } from "react";

const Greeting = () => {
  const [text, setText] = useState('');
  return (
    <div>
      <h2>Hello World</h2>
      <p>I am React developer. I can help you!</p>
      <button>Change text</button>
    </div>
  );
};

export default Greeting;
